import React, { useState } from "react";
import { TileList } from "../../components/tileList/TileList";
import { PetInfoForm } from "../../components/petInfoForm/PetInfoForm";

export const PetInfoPage = ({ contacts }) => {
  const [petInfo, setPetInfo] = useState([]);
  
  const addPetInfo = (newPetInfo) => {
    setPetInfo([...petInfo, newPetInfo]);
  };
  
  return (
    <div>
      <section>
        <h2>Pet Info</h2>
        <PetInfoForm contacts={contacts} handleSubmit={addPetInfo} />
      </section>
      <hr />
      <section>
        <h2>Pet List</h2>
        <TileList data={petInfo} />
      </section>
    </div>
  );
};
